import React from 'react';
import BaseLayout from '../components/layouts/BaseLayout';


class Cv extends React.Component {
    render() {
        return (
        <BaseLayout>
        <h1> This page is CV!  </h1>
        </BaseLayout>
    )
    }
}
export default Cv;
